import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      category: 'Frontend',
      skills: ['React', 'JavaScript', 'HTML5', 'CSS3', 'Three.js', 'WebGL']
    },
    {
      category: 'Backend',
      skills: ['Node.js', 'Express', 'MongoDB', 'RESTful APIs']
    },
    {
      category: 'Tools & Others',
      skills: ['Git', 'Webpack', 'VS Code', 'Responsive Design', '3D Modeling']
    }
  ];

  return (
    <div className="page-content">
      <h1>Skills</h1>
      <p>Here are some of the technologies and tools I work with:</p>

      <div className="skills-container">
        {skillCategories.map((category, index) => (
          <div key={index} className="skill-category">
            <h2>{category.category}</h2>
            <ul className="skills-list">
              {category.skills.map((skill, skillIndex) => (
                <li key={skillIndex}>{skill}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Skills;
